import { Box, Tab, Tabs } from 'grommet';
import React from 'react';

function TabsForm() {
    return(
        <Box>
            <Tabs>
                <Tab title="Procurement Section">
                    <Box pad="medium">Device NameTwo</Box>
                </Tab>
                <Tab title="Forwarder Section">
                    <Box pad="medium">Device NameTwo</Box>
                </Tab>
                <Tab title="CHA Section">
                    <Box pad="medium">Device NameTwo</Box>
                </Tab>
            </Tabs>
        </Box>
    );
}

export default TabsForm;
